import styled from 'styled-components';

const SettingsSpaceShipContainer = styled.div`
  width: 90%;
  margin: 0 auto;

  border: 2px solid #ffffff;
  border-radius: 10px;
`;

const SettingsSpaceShip = () => {
  return (
    <>
      <p style={{font}}>Your spaceship:</p>
      <SettingsSpaceShipContainer></SettingsSpaceShipContainer>
    </>
  );
};

export default SettingsSpaceShip;
